import React, { Component } from 'react';
import { withRouter, Switch, Route } from 'react-router-dom';
import HomePage from 'containers/HomePage';

class App extends Component {
    render() {
        return (
            <Switch>
                <Route path="/" exact>
                    <HomePage/>
                </Route>
            </Switch>
        );
    }
}

export default withRouter(App);
